import './App.css';
import {Routes, Route} from 'react-router-dom'
import Header from './components/Header';
import Article from './pages/Article';

import Home from './pages/Home';

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/article" element={<Article />} />
      </Routes>
    </div>
  );
}

export default App;
